import React from 'react';

const BrowseSpaces = ({ setCurrentView }) => {
    return (
        <div style={{ padding: '2rem' }}>
            <div style={{ maxWidth: '1200px', margin: '0 auto' }}>
                <div style={{ marginBottom: '2rem' }}>
                    <button
                        onClick={() => setCurrentView('home')}
                        style={{
                            background: 'none',
                            border: 'none',
                            color: '#667eea',
                            cursor: 'pointer',
                            fontSize: '16px',
                            marginBottom: '1rem'
                        }}
                    >
                        ← Back to Home
                    </button>
                    <h1 style={{ fontSize: '2.5rem', marginBottom: '1rem' }}>Browse Spaces</h1>
                    <p style={{ fontSize: '1.2rem', color: '#666' }}>
                        Discover amazing spaces for your next project
                    </p>
                </div>

                <div style={{
                    display: 'grid',
                    gridTemplateColumns: 'repeat(auto-fit, minmax(350px, 1fr))',
                    gap: '2rem'
                }}>
                    {[
                        {
                            title: "Modern Gallery Space",
                            category: "Gallery/Exhibition",
                            location: "Auckland CBD",
                            price: 150,
                            capacity: 50,
                            amenities: ["WiFi", "AV Equipment", "Climate Control"]
                        },
                        {
                            title: "Industrial Workshop Space",
                            category: "Workshop/Class Space",
                            location: "Ponsonby",
                            price: 80,
                            capacity: 20,
                            amenities: ["WiFi", "Parking", "Tools"]
                        },
                        {
                            title: "Boutique Retail Pop-up",
                            category: "Retail Pop-Up",
                            location: "Newmarket",
                            price: 200,
                            capacity: 30,
                            amenities: ["WiFi", "Security System", "Display Units"]
                        },
                        {
                            title: "Creative Studio Space",
                            category: "Workshop/Class Space",
                            location: "Parnell",
                            price: 120,
                            capacity: 25,
                            amenities: ["WiFi", "Natural Light", "Parking"]
                        },
                        {
                            title: "Event Hall",
                            category: "Event Hall",
                            location: "Auckland CBD",
                            price: 300,
                            capacity: 100,
                            amenities: ["WiFi", "AV Equipment", "Catering Kitchen"]
                        },
                        {
                            title: "Yoga Studio",
                            category: "Yoga/Wellness Studio",
                            location: "Grey Lynn",
                            price: 90,
                            capacity: 15,
                            amenities: ["Sound System", "Mirrors", "Mats"]
                        }
                    ].map((space, index) => (
                        <div key={index} style={{
                            backgroundColor: 'white',
                            borderRadius: '12px',
                            padding: '1.5rem',
                            boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
                            border: '1px solid #e2e8f0'
                        }}>
                            <div style={{
                                height: '200px',
                                backgroundColor: '#f7fafc',
                                borderRadius: '8px',
                                marginBottom: '1rem',
                                display: 'flex',
                                alignItems: 'center',
                                justifyContent: 'center',
                                color: '#a0aec0'
                            }}>
                                📸 Photo
                            </div>

                            <h3 style={{
                                fontSize: '1.25rem',
                                fontWeight: 'bold',
                                marginBottom: '0.5rem',
                                color: '#2d3748'
                            }}>
                                {space.title}
                            </h3>

                            <p style={{
                                color: '#667eea',
                                fontSize: '0.9rem',
                                marginBottom: '0.5rem'
                            }}>
                                {space.category}
                            </p>

                            <p style={{
                                color: '#718096',
                                fontSize: '0.9rem',
                                marginBottom: '1rem'
                            }}>
                                📍 {space.location}
                            </p>

                            <div style={{ marginBottom: '1rem' }}>
                                {space.amenities.map((amenity, i) => (
                                    <span key={i} style={{
                                        backgroundColor: '#edf2f7',
                                        color: '#4a5568',
                                        padding: '0.25rem 0.5rem',
                                        borderRadius: '4px',
                                        fontSize: '0.75rem',
                                        marginRight: '0.5rem',
                                        marginBottom: '0.5rem',
                                        display: 'inline-block'
                                    }}>
                                        {amenity}
                                    </span>
                                ))}
                            </div>

                            <div style={{
                                display: 'flex',
                                justifyContent: 'space-between',
                                alignItems: 'center'
                            }}>
                                <div>
                                    <span style={{
                                        fontSize: '1.5rem',
                                        fontWeight: 'bold',
                                        color: '#2d3748'
                                    }}>
                                        ${space.price}
                                    </span>
                                    <span style={{ color: '#718096', fontSize: '0.9rem' }}>/day</span>
                                </div>
                                <span style={{ color: '#718096', fontSize: '0.9rem' }}>
                                    Capacity: {space.capacity}
                                </span>
                            </div>

                            <button style={{
                                width: '100%',
                                backgroundColor: '#667eea',
                                color: 'white',
                                border: 'none',
                                padding: '0.75rem',
                                borderRadius: '6px',
                                fontSize: '1rem',
                                fontWeight: '500',
                                cursor: 'pointer',
                                marginTop: '1rem'
                            }}>
                                View Details
                            </button>
                        </div>
                    ))}
                </div>
            </div>
        </div>
    );
};

export default BrowseSpaces;
